class Solution:
    def maximalRectangle(self, matrix):
        """
        :type matrix: List[List[str]]
        :rtype: int
        """
        if not matrix:
            return 0
        col_l = len(matrix)
        row_l = len(matrix[0])
        cache_matrix = [([0] * row_l) for _ in range(col_l)]
        result = 0
        for i in range(col_l):
            row_sum = 0
            for j in range(row_l):
                if matrix[i][j] == '1':
                    row_sum += 1
                    cache_matrix[i][j] = row_sum
                else:
                    row_sum = 0
        for i in range(col_l):
            for j in range(row_l):
                if not cache_matrix[i][j]:
                    continue
                # if j < row_l-1 and cache_matrix[i][j] < cache_matrix[i][j + 1]:
                #     if 0 < i and cache_matrix[i - 1][j] >= cache_matrix[i][j] >= cache_matrix[i - 1][j + 1]:
                #         pass
                #     elif i < col_l-1 and cache_matrix[i + 1][j] >= cache_matrix[i][j] >= cache_matrix[i + 1][j + 1]:
                #         pass
                #     else:
                #         continue
                if col_l*cache_matrix[i][j] <= result:
                    continue
                h = 1
                for z in range(i-1, -1, -1):
                    if cache_matrix[z][j] >= cache_matrix[i][j]:
                        h += 1
                    else:
                        break
                for z in range(i+1, col_l):
                    if cache_matrix[z][j] >= cache_matrix[i][j]:
                        h += 1
                    else:
                        break
                result = max(h*cache_matrix[i][j], result)
                # print(result, i, j)
        return result



